import React from "react";
// importing App.js variables.
export default function Main({ page }) {
    function renderPage() {
        switch (page) {
            case ("about"):
                return (
                    //  title and section are selected by default
                    <div>a</div>
                )
            case ("portfolio"):
                return (
                    // titled images of six of the developer’s applications with links to both the deployed applications and the corresponding GitHub repository
                    <div>p</div>
                )
            case ("resume"):
                return (
                    // bullet list of skillset and download link for resume
                    <div>
                        <p>Click <a href="">here</a> to download my resume.</p>
                        </div>
                )
            case ("contact"):
                return (
                    // name form, email form, and message form will go here.

                    // class names should match with index.css
                    <form>
                        <div class="form-group">
                            <label for="name-input">Name</label><br></br>
                            <input type="text" class="form-input" id="name-input" 
                                placeholder="Enter your name"></input>
                        </div>
                        <div class="form-group pb-2">
                            <label for="email-input">Email</label><br></br>
                            <input type="text" class="form-input" id="email-input" placeholder="Enter your email"></input>
                        </div>
                        <div class="form-group pb-2">
                            <label for="message-input">Message</label><br></br>
                            <textarea type="text" class="form-input" id="message-input" placeholder="Enter a message"></textarea>
                        </div>

                        <button class="btn btn-primary">Submit</button>
                     
                    </form>
                )

        }
    }
    return (
        <div className="header">
            {renderPage()}
        </div>
    );


}
